  constructor(props) {
    super(props);
  }

  getPageType() {
    console.log(this.props.type);
  }

  render() {
    return (
      <div>
        {this.props.type == "Information" ? (
          <InformationPage />
        ) : this.props.type == "Map" ? (
          <Map />
        ) : this.props.type == "InterviewLocations" ? (
          <InterviewLocations />
        ) : (
          <Volunteer />
        )}
      </div>
    );
  }
}

